    let location = useLocation()
    console.log(location)
    let loginToken=location.pathname.substring(location.pathname.lastIndexOf('/') + 1)
    console.log(loginToken)
    //commerce.customer.getToken(loginToken).then((jwt) => {console.log(jwt); }); //the customer is now automatically saved in local session storage,
    // here should wait for the uppper commerce api to be returned
    commerce.customer.getOrders().then((orders) => console.log(orders))
    commerce.customer.about().then((customer) => console.log(customer))
    console.log(commerce.customer.isLoggedIn());
    //commerce.customer.logout();


    return (
      <main style={{ padding: "1rem 0" }}>
        <h2>登録が完了しました</h2>
        <Item sx={{height:150}}><Button variant="outlined" component={Link} to="/cart" >買い物かごを見る</Button><Button variant="outlined" component={Link} to="/orders" >注文履歴を見る</Button></Item>
      </main>
    );
  }
